/*Table structure for table `metapath` */

DROP TABLE IF EXISTS `metapath`;

CREATE TABLE `metapath` (
  `reviewid` int(11) NOT NULL,
  `spam` varchar(100) NOT NULL,
  `score` double DEFAULT NULL,
  `feature` varchar(100) NOT NULL,
  PRIMARY KEY (`reviewid`,`feature`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `metapath` */

/*Table structure for table `purchase` */

DROP TABLE IF EXISTS `purchase`;

CREATE TABLE `purchase` (
  `sno` int(11) NOT NULL AUTO_INCREMENT,
  `id` varchar(10) DEFAULT NULL,
  `sub` varchar(100) DEFAULT NULL,
  `cost` varchar(100) DEFAULT NULL,
  `freq` varchar(100) DEFAULT NULL,
  `tot_cost` varchar(100) DEFAULT NULL,
  `user` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`sno`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

